export { GET_FOODS, ADD_FOOD } from "../actions/types";

const initialState = {
	foods: [
		{ name: "cake", img: "cake_img" },
		{ name: "donuts", img: "donuts_img" },
	],
};

export default function (state = initialState, action) {
	switch (action.type) {
		case GET_ITEMS:
			return {
				...state,
			};
		default:
			return state;
	}
}
